(15, 'Arianny Herrera', 'arianny-herrera-1', 'IUZ7gHeDpdPYW0T1YHUbQNIKAR43', 'ariannyherrera630@gmail.com', '8094150348', '1760363841.6219.jpeg', 'Autopista Ramón Cáceres frente A Moca industrial', NULL, '0', 1, NULL, 1, 1, '2025-10-08 19:02:24', '2025-10-13 14:04:18', 'I am a dedicated real estate agent committed to helping each client find their ideal home or investment. I’m known for offering personalized service based on trust, transparency, and dedication. As part of the Omko Real Estate team, I specialize in the sale and rental of residential properties, land, and tourism projects in the best areas of the country. My goal is to guide you through every step of the process and make your real estate experience safe, clear, and successful.', 'https://www.facebook.com/share/1Dpshi4Vj2/?mibextid=wwXIfr', NULL, 'https://www.instagram.com/arianny_omko?igsh=cTh0cDBrM3FwNTZt&utm_source=qr', NULL, NULL, NULL, NULL, NULL, NULL, 0);
INSERT INTO `faqs` (`id`, `question`, `answer`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'What documents do I need to buy a property in the Dominican Republic?', 'You will need your ID card or passport (if you\'re a foreigner), proof of funds or financing approval, and a notarized purchase agreement.', 1, '2024-12-20 19:22:04', '2024-12-20 19:22:04', NULL),
(2, 'Are there restrictions for foreigners buying property in the Dominican Republic?', 'No, foreigners can purchase properties freely and have the same legal rights as Dominican citizens.', 1, '2024-12-20 19:24:11', '2024-12-20 19:24:11', NULL),
(3, 'What taxes do I have to pay when buying a property?', 'You must pay a Transfer Tax equivalent to 3% of the registered property value. Additionally, an annual property tax (IPI) applies to properties valued over RD$7,710,158.', 1, '2024-12-20 19:25:41', '2024-12-20 19:25:41', NULL),
(4, 'How is the property I’m buying secured?', 'All properties undergo a legal verification process, including a title review, to ensure they are free of liens or encumbrances.', 1, '2024-12-20 19:26:21', '2024-12-20 19:26:21', NULL),
(5, 'Can I finance the purchase of a property?', 'Yes, you can finance your purchase through a local bank or direct financing options offered by some developers.', 1, '2024-12-20 19:29:13', '2024-12-20 19:29:13', NULL),
(6, 'What are the benefits of investing in real estate in the Dominican Republic?', 'The country offers high appreciation rates in tourist areas, tax benefits under the CONFOTUR Law, and opportunities to generate income through vacation rentals.', 1, '2024-12-20 19:30:26', '2024-12-20 19:30:26', NULL),
(7, 'What does the price of an off-plan property include?', 'The price typically includes the land, construction, finishes, common areas, and project amenities. Additional features like pools or terraces may have extra costs.', 1, '2024-12-20 19:30:59', '2024-12-20 19:30:59', NULL),
(8, 'What is a presale agreement?', 'It’s a contract signed before the property is fully built, securing the price and conditions of the property while the development is completed.', 1, '2024-12-20 19:31:53', '2024-12-20 19:31:53', NULL),
(9, 'How can I generate income from my property?', 'Properties in tourist areas are ideal for vacation rentals through platforms like Airbnb or for long-term rentals.', 1, '2024-12-20 19:32:36', '2024-12-20 19:32:36', NULL),
(10, 'What is the process for registering a property?', 'Once the purchase is completed, the property title must be registered under the buyer\'s name at the Land Registry. This process is handled by a lawyer or real estate manager.', 1, '2024-12-20 19:33:34', '2024-12-20 19:33:34', NULL),
(11, 'What happens if the property I purchase is part of a tourist development?', 'Tourist developments may offer tax benefits under the CONFOTUR Law, such as exemptions from transfer and property taxes for several years.', 1, '2024-12-20 19:34:20', '2024-12-20 19:34:20', NULL),
(12, 'What is the CONFOTUR Law?', 'The CONFOTUR Law (Law 158-01) is a Dominican Republic regulation that offers tax incentives to promote tourism-related projects. It exempts buyers from property transfer tax (3%), annual property tax (IPI), and other municipal taxes for up to 10 years, making it highly attractive for investors in tourist areas like Punta Cana and Bávaro.\r\n\r\nIf you have questions or need guidance on CONFOTUR-approved properties, feel free to contact us!', 1, '2024-12-20 19:37:37', '2024-12-20 19:37:37', NULL),
(13, 'How long does it take to close a real estate transaction?', 'The closing process typically takes 30 to 90 days, depending on legal verification and financial arrangements.', 1, '2024-12-20 19:45:35', '2024-12-20 19:45:35', NULL),
(14, 'Do I need to hire a lawyer to buy a property?', 'While not mandatory, it is highly recommended to hire a lawyer to review contracts and ensure a secure process.', 1, '2024-12-20 19:47:30', '2024-12-20 19:47:30', NULL);
