INSERT INTO `propertys` (`id`, `category_id`, `package_id`, `title`, `description`, `address`, `client_address`, `propery_type`, `price`, `post_type`, `city`, `country`, `state`, `title_image`, `three_d_image`, `video_link`, `latitude`, `longitude`, `added_by`, `status`, `total_click`, `created_at`, `updated_at`, `rentduration`, `slug_id`, `meta_title`, `meta_description`, `meta_keywords`, `meta_image`, `is_premium`) VALUES
(1, '1', 0, 'Villas Gold Reef Playa Nueva Romana', 'Beautiful villas located in La Romana within the Playa Nueva Romana real estate complex. Currently the fastest growing in the Dominican Republic.\r\n\r\nThe villas overlook the PGA OCEAN\'S 4 golf course which is strategically located in the beautiful bay of Playa Nueva Romana in the Dominican Republic. By becoming an investor in your Gold Reef Villa you will enjoy the most complete golf facilities in a place you will never forget.\r\n\r\nSummary of the benefits of the Law 158-01 (Confotur) By making a real estate investment in a tourist destination that enjoys the benefits of this law, you will save 18% over time, i.e. 1% of the real estate wealth tax (IPI) and 3% of the title transfer tax. It is important to note that the 15 years of benefits in the IPI exemption begin to run once the property is terminated in accordance with article 7 of the aforementioned Law.', 'Playa Nueva Romana', 'Calle Rosario 150', 0, 455000, '1', 'Playa Nueva Romana', 'Dominican Republic', 'La Romana', '1735405416.8762.jpg', '1735405416.8773.jpg', '', '18.452781', '-69.1858074,15', 1, 1, 59, '2024-11-24 02:33:57', '2025-10-07 16:10:09', 'Daily', 'villas-gold-reef-playa-nueva-romana', NULL, NULL, NULL, '1735405416.8768.jpg', 0),
(2, '1', NULL, 'Caleana Residences 20 Beautiful Villas Townhouse  Style', 'Welcome to CALEANA RESIDENCES, an exclusive complex of 20 modern townhouse-style villas, designed to offer you luxury, comfort, and high profitability. These residences are the perfect home or the best investment for those seeking a unique space in the heart of Punta Cana.  \r\n                           \r\nSituated near the best beaches such as Arena Gorda, Macao, Los Corales, and El Cortecito, and just 15 minutes from Punta Cana International Airport, this project combines accessibility with tranquility in a prime setting.\r\n\r\nAt CALEANA RESIDENCES, we offer you a stylish, secure, and comfortable home, designed to provide the perfect space for enjoying the luxury and privacy you deserve. This project is more than an investment; it’s an opportunity to live surrounded by nature and paradisiacal beaches.\r\n\r\nDon’t wait to discover your next home or the investment that will change your life. Experience CALEANA RESIDENCES, your oasis in Punta Cana!', 'Strategically Located for Maximum Convenience Just 500 meters from the Boulevard del Este and directly across from the entrance to Cocotal.', 'Barrio Don Bosco', 0, 135000, '1', 'Punta Cana', 'República Dominicana', 'La Altagracia', '1733880081.2593.jpeg', '1733880081.2604.jpeg', '', '18.5600761', '-68.372535', 3, 1, 62, '2024-12-11 01:21:21', '2025-10-28 11:30:17', '', 'caleana-residences-20-beautiful-villas-townhouse-style', 'Luxury Townhouse Villas in Punta Cana - CALEANA RESIDENCES', 'Discover CALEANA RESIDENCES: 20 modern villas in Punta Cana near top beaches. Luxury, comfort, and profitability await just 15 minutes from the airport.', 'CALEANA RESIDENCES, luxury villas Punta Cana, modern townhouses, investment in Punta Cana, beachfront villas, real estate Dominican Republic, secure villas, homes near Macao.', '1733880081.2598.jpeg', 0),
(3, '10', NULL, 'Rooftop Luxury Residences Punta Cana', 'Punta Cana is recognized as the number one tourist destination in the Caribbean, thanks to its stunning white-sand beaches, crystal-clear waters, and top-tier hotel offerings. It’s an ideal location for luxury tourism, family vacations, weddings, and honeymoons. The area also stands out for its modern infrastructure, easy accessibility, and a wide variety of recreational activities, from water sports to world-class golf.\r\n\r\n33 apartments with high investment potential, strategically located just 4 minutes from Downtown Punta Cana. These apartments are part of a peaceful community that has experienced exponential real estate growth.', 'Veron Bavaro', 'Calle Rosario #150, Barrio Roque Moca', 0, 115000, '1', 'Punta Cana', 'República Dominicana', 'La Altagracia', '1734127336.4731.jpeg', '1734127336.4742.jpeg', '', '18.5600761', '-68.372535', 5, 1, 46, '2024-12-13 22:02:16', '2025-10-27 09:49:48', '', 'rooftop-luxury-residences-punta-cana', 'Luxury Apartments Near Downtown Punta Cana - Invest Now', 'Discover 33 luxury apartments just 4 minutes from Downtown Punta Cana. Strategically located in a peaceful, fast-growing community, these properties offer high investment potential in the Caribbean’s top tourist destination.', 'Punta Cana apartments, real estate investment, luxury apartments, Downtown Punta Cana, Caribbean tourism, high ROI properties, Punta Cana real estate', '1734127336.4737.jpeg', 0),
(4, '7', NULL, 'Commercial Space for Rent', 'Looking for the perfect location for your business?\r\nThis space is ideal for: \r\n✔ Vehicle dealers \r\n✔ Car wash services \r\n✔ Auto repair shops \r\n✔ And other businesses\r\n\r\nStrategically located, it offers the necessary infrastructure to adapt to your business needs. Grow your business in a place designed for success.', 'Calle Rosario, Los Lopez', 'Calle Rosario #150, Barrio Roque Moca', 1, 100000, '1', 'Moca', 'República Dominicana', 'Espaillat', '1735013958.8781.jpg', '1735013958.8787.jpg', '', '19.3908634', '-70.5231108', 5, 1, 27, '2024-12-18 17:31:39', '2025-10-03 02:03:54', 'Yearly', 'commercial-space-for-rent', 'Commercial Space for Rent in Moca | Ideal for Businesses', 'Rent the best commercial space in Moca for your business. Ideal for vehicle dealers, car washes, auto repair shops, and more. Contact us now!', 'commercial space for rent, space for rent in Moca, businesses in Moca, vehicle dealers, car wash services, auto repair shops, commercial property rental, investment in Moca.', '1734543099.206.jpeg', 0),
