(22, '10', NULL, '3-Bedroom Apartment for Rent in El Caimito', 'Experience comfort and security with this spacious 3-bedroom apartment for rent in El Caimito. Priced at just RD$18,000, it features 2 bathrooms, a modern kitchen with a pantry, a laundry area, and a private balcony. Located in a gated residential community, it includes essential amenities like a cistern, tinaco, and 3 storage spaces. With its prime location and practical layout, this apartment is perfect for families or professionals seeking quality living. Reserve your spot now!', 'Caimito de la Rosario', 'Calle Rosario #150, Barrio Roque Moca', 1, 310, '1', 'Moca', 'República Dominicana', 'Espaillat', '1737559988.201.jpg', '1737559988.2017.jpg', '', '19.395527314546896', '-70.51018898564455', 5, 0, 17, '2025-01-22 15:33:08', '2025-10-08 18:34:30', 'Monthly', '3-bedroom-apartment-for-rent-in-el-caimito', 'Spacious 3-Bedroom Apartment in El Caimito – RD$18,000', 'Rent a 3-bedroom apartment in El Caimito for RD$18,000. Features 2 baths, a balcony, gated community, and parking. Contact OMKO Real Estate today!', '3-bedroom apartment RD, El Caimito rentals, gated community apartment RD, apartment for rent Dominican Republic, OMKO Real Estate listings, secure apartments Moca, family-friendly rentals RD, spacious apartments Dominican Republic, Moca real estate properties, rental homes in El Caimito', '1737559988.2014.jpg', 0),
(23, '7', NULL, 'Commercial Building with Supermarket for Sale', 'Invest in a prime commercial property in Sabaneta de Yasica! This two-story building spans 295 m² and includes a fully operational supermarket on the ground floor with top-tier equipment, a spacious office, and a rentable local. The second level serves as a 100 m² warehouse. With solar panels, security systems, and strategic visibility, this property is ideal for retail, supermarkets, or other ventures. Choose the complete package (building + business) for RD$35M or the building alone for RD$32M. Don’t miss this rare opportunity!', 'Sabaneta de Yasica.', 'Calle Rosario #150, Barrio Roque Moca', 0, 600000, '1', 'Sabaneta de Yásica', 'República Dominicana', 'Puerto Plata', '1737596009.9485.jpg', '1737596009.9495.jpg', '', '19.675264300828577', '-70.37822430211183', 5, 1, 6, '2025-01-23 01:33:29', '2025-09-11 18:40:11', '', 'commercial-building-with-supermarket-for-sale', 'Commercial Building with Supermarket in Sabaneta – RD$35M', 'For sale: 295 m² commercial building with supermarket. Fully equipped, prime location in Sabaneta de Yasica. Options from RD$32M. Contact OMKO today!', 'commercial property Dominican Republic, supermarket for sale RD, business investment RD, Sabaneta de Yasica properties, OMKO Real Estate listings, retail property Dominican Republic, solar-powered building RD, commercial building for sale, profitable investments RD, real estate opportunities Dominican Republic', '1737596009.9489.jpg', 0),
(24, '1', NULL, 'Luxury Villas with Pool & Jacuzzi – Ana María Residences', 'Discover the luxury of Ana María Residences! These 3-level villas offer 325 m² of premium construction on 200 m² plots. Featuring spacious bedrooms, a private pool, jacuzzi, open terraces, and modern finishes, they redefine comfort and elegance. Perfect for families or investors, with delivery options in 12, 18, or 24 months. Reserve now for just USD 2,000 and own your slice of paradise near Bávaro and Punta Cana', 'Bavaro, Punta Cana', 'Calle Rosario #150, Barrio Roque Moca', 0, 275000, '1', 'Punta Cana', 'República Dominicana', 'La Altagracia', '1737738674.1886.jpg', '1737738674.1891.jpg', '', '18.606230437623502', '-68.39905445653078', 5, 1, 6, '2025-01-24 15:18:18', '2025-09-12 05:48:55', '', 'luxury-villas-with-pool-jacuzzi-ana-mara-residences', 'Luxury Villas in Ana María Residences – USD 275,000', 'Own a 3-level luxury villa with pool, jacuzzi, and premium finishes at Ana María Residences. Price: USD 275,000. Reserve with USD 2,000. Contact OMKO Real Estate!', 'luxury villas Punta Cana, Ana María Residences, villas with pool Dominican Republic, real estate Bávaro, OMKO properties, luxury homes RD, investment properties Punta Cana, villas for sale Bávaro, modern villas Dominican Republic, premium real estate RD', '1737731898.185.jpg', 0),
(25, '10', NULL, 'Modern Living in Arroyo Hondo, Santiago', 'Your dream home awaits in Arroyo Hondo, Santiago! This exclusive gated community of 20 apartments offers modern design and comfort, featuring 2- and 3-bedroom options with balconies, breakfast bar kitchens, and panoramic rooftop views. Enjoy the First-Home Buyer Incentive and tax exemption. Prices start at just US$84,000. Reserve now with only US$2,000 and elevate your lifestyle today.', 'Arroyo Hondo', 'Calle Rosario #150, Barrio Roque Moca', 0, 84000, '1', 'Santiago de los Caballeros', 'República Dominicana', 'Santiago', '1737832747.6843.jpg', '1737832747.6852.jpg', '', '19.40787319663596', '-70.70479934292908', 5, 1, 77, '2025-01-25 19:19:07', '2025-10-09 00:37:17', '', 'modern-living-in-arroyo-hondo-santiago', 'Modern Apartments in Arroyo Hondo from US$84,000 | OMKO', 'Discover your modern apartment in Arroyo Hondo, Santiago. 2-3 bedrooms, first-home buyer bonus, tax exemption, panoramic views. Reserve with US$2,000 today!', 'apartment for sale santiago, arroyo hondo apartments, modern apartments, first home buyer bonus, affordable apartments, investment in santiago, trust fund project, apartments with balcony, economic apartments DR, omko real estate\r\n\r\n\r\napartment for sale santiago, arroyo hondo apartments, modern apartments, first home buyer bonus, affordable apartments, investment in santiago, trust fund project, apartments with balcony, economic apartments DR, omko real estate', '1737832747.6847.jpg', 0),
(26, '10', NULL, 'Apartment for Rent in Maricarmen - RD$20,000', 'OMKO offers this rental apartment in Mary Carmen for just RD$20,000. Featuring 3 bedrooms, 2 bathrooms, a living room, dining area, kitchen, balcony, and gallery, this space provides the comfort you need. Additionally, it includes a walking closet, water tank (tinaco), water pump, and 3 storage spaces. Perfect for those seeking a central and well-equipped location.', 'Residencial Maricarmen', 'Calle Rosario #150, Barrio Roque Moca', 1, 335, '1', 'Moca', 'República Dominicana', 'Espaillat', '1738018967.5911.jpg', '1738018967.592.jpg', '', '19.379921589109077', '-70.51209871846315', 5, 0, 8, '2025-01-27 23:02:47', '2025-10-08 18:34:17', 'Monthly', 'apartment-for-rent-in-maricarmen-rd20000', 'Apartment for Rent in Mary Carmen | RD$20,000 | OMKO', 'Rent this 3-bedroom, 2-bathroom apartment in Mary Carmen for RD$20,000. Includes a walking closet, balcony, water tank, and more. Find your new home with OMKO!', 'apartment for rent, rent in Mary Carmen moca, 3 bedrooms, OMKO rental, affordable apartment, walking closet, RD$20,000, central apartment, real estate RD, Omko Real Estate', '1738018967.5915.jpg', 0),
(27, '10', NULL, '3rd Floor Apartment in Villas Carolina', 'Find your dream home with OMKO! This stunning 3rd-floor apartment in Villas Carolina offers comfort, style, and value. Priced at DOP 8,000,000 and featuring a deslindado title, it includes 3 spacious bedrooms (master with walk-in closet and private bathroom), 2 shared bathrooms, a half bath, living room, dining area, and a modern kitchen. Relax on the balcony and enjoy the convenience of 2 parking spaces (B3). Additional features include a cistern and intercom system for added security.', 'Villas  Carolina', 'Calle Rosario #150, Barrio Roque Moca', 0, 134000, '1', 'Moca', 'República Dominicana', 'Espaillat', '1738021407.9709.jpg', '1738021407.9716.jpg', '', '19.385245111014836', '-70.52349274235841', 5, 0, 10, '2025-01-27 23:38:50', '2025-10-08 18:34:12', '', '3rd-floor-apartment-in-villas-carolina', '3rd Floor Apartment in Villas Carolina -', 'Stylish 3-bedroom apartment in Villas Carolina, DOP 8M. Includes balcony, 2 parking spaces, cistern, intercom, and more. Perfect for comfort and convenience!', 'Villas Carolina apartment, 3-bedroom apartment, apartment for sale Moca, affordable housing Moca, OMKO Real Estate, Dominican Republic real estate, family apartment, property for sale RD', '1738021130.2712.jpg', 0),
(28, '5', NULL, 'Exclusive Lots for Sale in Moca – Prime Investment', 'Seize this investment opportunity in Moca! Two exclusive lots are available at an unbeatable price. Lot 1: 301 m², Lot 2: 300 m², both with deslindado titles and priced at just DOP 6,700 per m². These flat, ready-to-build lots are perfect for constructing your dream home or starting an agricultural project. Secure your future in one of Moca’s best locations.', 'Los Lopez', 'El Caimito del hospital #132', 0, 32950, '1', 'Moca', 'República Dominicana', 'Espaillat', '1738193380.4707.jpg', '1738193380.472.jpg', '', '19.400243147306803', '-70.54121677952882', 6, 0, 17, '2025-01-29 23:29:40', '2025-10-08 18:34:00', '', 'exclusive-lots-for-sale-in-moca-prime-investment', 'Exclusive Lots for Sale in Moca – Investment Opportunity', 'Build in Moca’s top location! Two prime lots (300+ m²), deslindado title, ready for construction. Great investment! Contact OMKO today.', 'lots for sale Moca, land for sale Dominican Republic, investment property RD, real estate Moca, build your home, exclusive land Moca, OMKO Real Estate', '1738193380.4713.jpg', 0),
(29, '4', NULL, 'House for Sale in Pueblo Bávaro – Perfect to Live or Invest', 'Discover this beautiful single-family home in Pueblo Bávaro, perfect for living or investing. With 124 m² of construction on a 253 m² lot, it features 3 bedrooms, the master with a walk-in closet and a bathroom with a bathtub, a living room, a dining room, and a functional kitchen. It also includes a covered garage for 2 vehicles. Located in a safe and quiet area with easy access to shops, services, and stunning beaches. Get it for just USD 150,000 and make your best investment in Punta Cana!', 'Pueblo Bavaro', 'Calle Rosario 150', 0, 150000, '1', 'Punta Cana', 'República Dominicana', 'La Altagracia', '1738769883.6861.jpg', '1738769883.6869.jpg', '', '18.60948419202559', '-68.40982620793459', 1, 1, 18, '2025-02-05 15:38:03', '2025-10-27 11:08:13', '', 'house-for-sale-in-pueblo-bvaro-perfect-to-live-or-invest', 'House for Sale in Pueblo Bávaro | OMKO Real Estate', 'Single-family home for sale in Pueblo Bávaro with 3 bedrooms, 2 bathrooms, a functional kitchen, and a covered garage. Price USD 150,000. Ideal investment in Punta Cana!', 'house for sale Pueblo Bávaro, real estate Punta Cana, property investment, single-family home, properties in the Dominican Republic, buy a house in Bávaro, real estate RD, home in Punta Cana.', '1738769883.6865.jpg', 0),
(30, '10', NULL, 'Luxury Apartments in Torre Monterrico – Santiago', 'Secure your dream home in Torre Monterrico, an exclusive gated project in Santiago with 24/7 security and trust-backed investment. These modern 101 m² apartments offer a spacious layout: living room, dining area, kitchen with breakfast nook, pantry, laundry, 3 bedrooms, walk-in closet, 2 bathrooms, and a balcony. Prices start at US$150,000, with premium units up to US$215,000. Reserve yours today with just US$5,000!', 'Santiago de los Caballeros', 'Calle Rosario #150, Barrio Roque Moca', 0, 150000, '1', 'Santiago de los Caballeros', 'República Dominicana', 'Santiago', '1742926032.4421.jpg', '1742926032.4436.jpg', '', '19.43704420784241', '-70.71512584763643', 5, 1, 13, '2025-03-25 17:55:05', '2025-09-17 15:03:28', '', 'luxury-apartments-in-torre-monterrico-santiago', 'Luxury Apartments in Torre Monterrico | OMKO Real Estate', 'Invest in Torre Monterrico, a gated project in Santiago. 101 m² apartments with 3 bedrooms, balcony & top security. Prices from US$150,000. Reserve now!', 'Torre Monterrico, apartments for sale Santiago, luxury apartments RD, investment property, real estate Santiago, 3-bedroom apartment, secure investment, buy apartment in Dominican Republic', '1742925305.608.jpg', 0),
(31, '10', NULL, 'Apartment for Sale in Griselda Residence – Moca', 'Live in comfort and security at Griselda Residence, an exclusive gated community in Juan López, Moca. This modern 110 m² apartment features 3 bedrooms, 2 bathrooms, living room, dining area, kitchen, laundry space, and balcony. Enjoy a 60 m² private patio, swimming pool, gym, and gazebo. With 2 parking spaces, electric gate, and intercom, you’ll have the peace of mind you deserve. All for US$159,000, with financing available!', 'Juan López Abajo Moca', 'Calle Rosario #150, Barrio Roque Moca', 0, 159000, '1', 'Juan Lopez', 'República Dominicana', 'Espaillat', '1743534308.4904.png', '1743534308.4938.png', '', '19.419891822092588', '-70.51308174806711', 5, 1, 69, '2025-04-01 19:05:08', '2025-11-17 00:30:12', '', 'apartment-for-sale-in-griselda-residence-moca', 'Apartment in Griselda Residence – Moca | OMKO Real Estate', 'Apartment for sale in Griselda Residence, Moca. 3 beds, 2 baths, private patio, pool, and more. Price US$159,000. Financing available!', 'apartment for sale Moca, Griselda Residence, real estate Moca, property investment DR, buy apartment DR, apartment with patio, financing available', '1743534308.493.png', 0),
(32, '4', NULL, 'Multifamily Home + 2 Apartments – Los Octavios, Moca', 'Amazing investment opportunity in Los Octavios, Moca. This multifamily property features a 2-level main house, a large terrace, and 2 independent apartments, perfect for living and rental income. With 400 m² of land and 200 m² of construction, it offers 6 bedrooms in the main house and 2 in each apartment, plus parking, a cistern, and 24/7 electricity. Strategically located just 5 minutes from downtown, close to hospitals, supermarkets, and schools. Secure your investment today for RD$17,450,000!', 'Los Octavios', 'Calle Rosario 150', 0, 279500, '1', 'Moca', 'República Dominicana', 'Espaillat', '1759510551.7403.jpg', '1759510551.7418.jpg', '', '19.386115480173377', '-70.52885984259721', 1, 1, 73, '2025-04-02 14:46:18', '2025-11-17 00:28:31', '', 'multifamily-home-2-apartments-los-octavios-moca', 'Multifamily + 2 Apts in Los Octavios, Moca | OMKO', 'Multifamily home with 2 apartments in Los Octavios, Moca. 6 beds, 4 baths, terrace & more. Price RD$17,450,000. Great investment opportunity!', 'house for sale Moca, real estate investment RD, multifamily home Moca, house with apartments, Moca properties, rental income property', '1743605178.4522.png', 0),
(33, '10', NULL, 'Luxury Oceanfront Living – The Reef, Playa Bonita', 'Experience luxury and nature at The Reef, Playa Bonita. This exclusive beachfront development in Las Terrenas offers modern, fully furnished apartments with breathtaking panoramic views. Enjoy 26,000 m² of protected nature, direct beach access, infinity pools, jacuzzis, a beach club, spa, gym, and premium dining options. Plus, 15 years of tax exemption under CONFOTUR. Invest in paradise from USD $245,000 and generate rental income while you\'re away. Schedule your private tour today!', 'Playa Bonita', 'Calle Rosario #150, Barrio Roque Moca', 0, 245000, '1', 'Las Terrenas', 'República Dominicana', 'Samaná', '1743612734.6929.png', '1743612734.6946.png', '', '19.31082148803694', '-69.56905548649904', 5, 1, 36, '2025-04-02 16:52:14', '2025-10-14 15:13:38', '', 'luxury-oceanfront-living-the-reef-playa-bonita', 'Luxury Beachfront Condos in Playa Bonita | The Reef', 'The Reef – Luxury beachfront apartments in Playa Bonita, Las Terrenas. Modern, fully furnished, with pools, spa, beach club & tax benefits. From $245K.', 'beachfront condos Dominican Republic, luxury apartments Las Terrenas, Playa Bonita real estate, investment properties Caribbean, The Reef Las Terrenas, condos for sale Dominican Republic.', '1743612734.6942.jpg', 0),
(34, '5', NULL, 'Exclusive Coffee Farm Investment – Juncalito', 'Invest in one of the best coffee-producing regions! This 800-task coffee farm in production, located at 1,200 meters above sea level in Juncalito, Santiago, offers ideal conditions for premium coffee cultivation. With easy access, a favorable climate, and expansion potential, this is a unique opportunity for investors and coffee enthusiasts. Secure your piece of the coffee industry for USD $1,000,000. Title in process.', 'Jucalito', 'Calle Rosario #150, Barrio Roque Moca', 0, 1000000, '1', 'Franco Bido', 'República Dominicana', 'Santiago', '1743696284.2454.png', '1743696284.2477.png', '', '19.195677590023102', '-70.81520979481813', 5, 1, 40, '2025-04-03 16:04:44', '2025-10-08 18:29:50', '', 'exclusive-coffee-farm-investment-juncalito', 'Coffee Farm for Sale in Juncalito – Investment Opportunity', 'Own a high-altitude coffee farm in Juncalito, Santiago. 800-task farm in production, perfect for investment. Price: $1M. Title in process.', 'coffee farm for sale Dominican Republic, coffee investment opportunity, high-altitude coffee farm, Santiago real estate, agricultural land for sale, Dominican Republic coffee plantations', '1743696284.2471.png', 0),
(35, '4', NULL, 'Live & Invest in One Place – La Piragua Moca', 'Exclusive property perfect for living and doing business! This spacious 726.5 m² home in Moca offers comfort and income potential in one single investment.\r\n\r\nThe first floor includes 3 bedrooms, 3 bathrooms, two living rooms, a family room, terrace dining area, porch, front garden, and a commercial space ready to generate income.\r\n\r\nThe second floor features an independent apartment with 2 bedrooms, 2 bathrooms, living room, dining area, kitchen, and a balcony.\r\n\r\nAdditional features: parking for 3+ vehicles, 24/7 water and electricity.\r\nPrice: RD$12,600,000.00 – A rare opportunity in a great location!', 'La Piragua', 'Calle Rosario #150, Barrio Roque Moca', 0, 200000, '1', 'Moca', 'República Dominicana', 'Espaillat', '1744042490.2691.jpg', '1744042490.2733.jpg', '', '19.387471627497003', '-70.50973837453004', 5, 1, 24, '2025-04-07 16:14:50', '2025-11-17 10:34:30', '', 'live-invest-in-one-place-la-piragua-moca', 'Mixed-Use Property for Sale – Moca, DR', '726.5 m² property in Moca with home + commercial space. 5 beds, 5 baths, parking, 24/7 utilities. Perfect to live and invest. RD$12,600,000.', 'property for sale Moca, house with commercial space, real estate DR, invest in Dominican Republic, large property Moca, multifamily home DR, Omko Real Estate', '1744042490.2698.jpg', 0),
(36, '7', NULL, 'Spacious Rentals with Elevator Access', 'Take your business to the next level in one of the most exclusive commercial buildings in town. These second-floor commercial spaces with elevator offer the visibility and comfort your company deserves.\r\n\r\nChoose between 800 m² for US$4,800/month or 1,600 m² for US$8,000/month, each featuring:\r\n\r\n✔ Private entrance\r\n✔ Private bathrooms\r\n✔ Personal storage room\r\n✔ Modern elevator\r\n✔ Ample customer parking\r\n\r\nLocated in a high-traffic commercial zone, these spaces are perfect for corporate offices, clinics, academies, or showrooms.\r\n\r\nYour next big move starts here!', 'El Caimito', 'Calle Rosario #150, Barrio Roque Moca', 1, 4800, '1', 'Moca', 'República Dominicana', 'Espaillat', '1744044832.0825.jpg', '1744044832.0833.jpg', '', '19.38977907608604', '-70.51829730349657', 5, 0, 26, '2025-04-07 16:53:52', '2025-11-21 02:48:02', 'Monthly', 'spacious-rentals-with-elevator-access', 'Commercial Rentals with Elevator – 800 & 1600 m²', 'commercial spaces for rent, rentals with elevator, office spaces, spacious rentals, commercial building, high traffic area, Omko Real Estate', 'Second-floor commercial spaces with elevator, storage, and parking. From 800 m² to 1600 m² in high-traffic area. Perfect for your business growth!', '1744044832.0829.jpg', 0);
