(37, '5', NULL, 'Prime Land for Housing or Investment', 'Incredible investment opportunity! This flat 37.5-task land is perfect for a residential or agricultural development. It features a clean title, access to electricity and water, and a strategic location near a main road. It also includes a 3-level villa with a swimming pool, ideal for living, renting, or using as part of your project.\r\n\r\nAppraised at RD$70M – Offer Price: RD$53M\r\nA unique chance to invest in high-potential land with great return prospects!', 'La Rosa', 'Calle Rosario #150, Barrio Roque Moca', 0, 870000, '1', 'Moca', 'República Dominicana', 'Espaillat', '1745350505.4724.jpg', '1745350505.4758.jpg', '', '19.356135668921947', '-70.50388043004152', 5, 1, 27, '2025-04-22 19:35:05', '2025-10-17 20:10:08', '', 'prime-land-for-housing-or-investment', 'Land with Villa & Pool – Great Investment Deal', 'land for sale, investment property, villa with pool, housing project land, agricultural land, Dominican Republic real estate, flat land for development, Omko Real Estate', '37.5 tasks of flat land with villa and pool. Ideal for housing or agriculture. Great location. Appraised at RD$70M, now for only RD$53M. Excellent investment.', '1745350505.4744.jpg', 0),
(38, '5', NULL, 'Prime Land for Development in Moca', 'Take advantage of this unique investment opportunity in one of Moca’s most exclusive residential areas! This 1,400 m² titled lot is fully planted with cassava—allowing you to generate immediate income while preparing your next real estate development.\r\n\r\nLocated in a premium neighborhood with paved roads and easy access, this property is ideal for apartment complexes or high-value construction projects.\r\n\r\nTop location + residential surroundings = smart investment.\r\nPrice: RD$16.7 million.\r\n\r\nMake your best investment with OMKO!', 'Villa Caroly', 'Calle Rosario #150, Barrio Roque Moca', 0, 270000, '1', 'Moca', 'República Dominicana', 'Espaillat', '1745353135.6834.jpg', '1745353135.6845.jpg', '', '19.381955883232056', '-70.52000050622102', 5, 0, 20, '2025-04-22 20:18:55', '2025-10-08 18:31:50', '', 'prime-land-for-development-in-moca', '1,400 m² Exclusive Land for Sale in Moca', 'Premium 1,400 m² land for sale in Moca. Ideal for apartment projects. Titled and ready to build. Excellent residential location. RD$16.7M. Invest smart.', 'land for sale Moca, residential lot Dominican Republic, real estate Moca, development land Moca, titled land, investment opportunity DR, Omko Real Estate', '1745353135.6842.jpg', 0);
