(85, 'about_us', '<p>At OMKO, we are leaders in real estate, dedicated to providing a wide range of properties tailored to meet the needs and aspirations of our clients. Our mission is to deliver security, trust, and satisfaction to families and investors, ensuring that each step in their real estate journey is seamless and successful.</p>\r\n<p>We pride ourselves on being more than just a real estate company&mdash;we are your trusted partner in making smart investments. Guided by professionalism, integrity, and personalized service, we work tirelessly to help you achieve your real estate goals.</p>\r\n<p>At OMKO, we make your best investment.</p>\r\n<h5><strong>Mission</strong></h5>\r\n<div>&ldquo;We are dedicated to finding homes that bring happiness and security, with an honest and professional approach.&rdquo;</div>\r\n<div>&nbsp;</div>\r\n<h5><strong>Vision</strong></h5>\r\n<div>&ldquo;To be a reliable company that helps people find their home, providing peace of mind and well-being.&rdquo;</div>\r\n<div>&nbsp;</div>\r\n<h5><strong>Values</strong></h5>\r\n<div>&bull;Honesty: We always act with transparency.</div>\r\n<div>&bull;Professionalism: We offer a careful and responsible service.</div>\r\n<div>&bull;Commitment: We stand by your side until you find the home you&rsquo;ve dreamed of.</div>', '2024-12-20 20:17:25', '2024-12-20 20:19:49');
